import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import Typewriter from 'typewriter-effect';


const header1 = 'Your passwords aren\'t as secure'
const header2 = 'as you think they are.'
const subheader1 = 'However, we can fix that.'

function HeaderComponent () {
	//return <h1>{props.header}</h1>
    return (
        <Typewriter
            onInit={(typewriter) => {
                typewriter.typeString('Hello World!')
                    .callFunction(() => {
                        console.log('String typed out!');
                    })
                    .pauseFor(2500)
                    .deleteAll()
                    .callFunction(() => {
                        console.log('All strings were deleted');
                    })
                    .start();
            }}
        />
    )        
}

function SubHeaderComponent (props) {
        return <h1>{props.sub}</h1>
}


function App () {
    return (
        <div>
            <div id='OpeningHeader'>
                <HeaderComponent/>
                <HeaderComponent header={header2} />
            </div>
            <div class='text'>
                <SubHeaderComponent sub={subheader1} />
            </div>
        </div>
        )
    }

ReactDOM.render(
    <App />,
    document.getElementById('app')

)
